// src/components/Courses/CourseCard.js
import React from 'react';

const CourseCard = ({ course }) => {
  return (
    <div className="course-card">
      <h2>{course.title}</h2>
      <p>{course.description}</p>
      <button>Enroll</button>
    </div>
  );
};

export default CourseCard;
